import styled from 'styled-components';

export const StyledHeader = styled.header`
  position: relative;
  background: rgb(255, 132, 24);
  background: linear-gradient(
    354deg,
    rgba(128, 136, 255, 1) 0%,
    rgba(255, 132, 24, 1) 100%
  );
  width: 100%;
  height: 400px;
  padding-top: 1px;
`;
